foreach (string command in S) // command is something like "c:\\a.exe"\n{\n    try\n    {\n        using (Process p = Process.Start(command))\n        {\n            // Wait for the process to exit (optional)\n            p.WaitForExit();\n        } // Process will be disposed here automatically.\n    }\n    catch (Exception e)\n    {\n        // Notify of process failure\n        Console.WriteLine($"Process failed: {e.Message}");\n    }\n}